(1, 1, 'The Wise Old Man and the Lion', 'A traditional Oromo folktale about wisdom, courage, and the relationship between humans and nature. This story teaches important life lessons through the adventures of a wise old man who encounters a lion in the forest.', 'audio', 'stories/wise_old_man_lion.mp3', 450, 1200, 'Afaan Oromo', 'all', 1, '2025-06-22 22:11:38', 'Folklore', 'Ali the Storykeeper', 'thumbnails/wise_old_man.jpg', 50.00, '2025-06-22 22:11:38', 0),
(2, 1, 'The Origin of Coffee', 'Discover the legendary story of how coffee was discovered in Ethiopia. This traditional tale tells of a young goat herder named Kaldi and his magical discovery that changed the world.', 'video', 'stories/origin_of_coffee.mp4', 600, 800, 'English', 'all', 1, '2025-06-22 22:11:38', 'Folklore', 'Ali the Storykeeper', 'thumbnails/coffee_origin.jpg', 75.00, '2025-06-22 22:11:38', 0),
(3, 1, 'The Clever Hare and the Hyena', 'A beloved Oromo folktale about cleverness and wit. The story follows a clever hare who outsmarts a greedy hyena through intelligence and quick thinking.', 'audio', 'stories/hare_hyena.mp3', 300, 900, 'Afaan Oromo', 'children', 1, '2025-06-22 22:11:38', 'Folklore', 'Ali the Storykeeper', 'thumbnails/hare_hyena.jpg', 40.00, '2025-06-22 22:11:38', 0),
(4, 2, 'The History of the Oromo People', 'A comprehensive historical account of the Oromo people, their migration, culture, and contributions to Ethiopian society. This educational story covers centuries of Oromo history.', 'text', 'stories/oromo_history.txt', NULL, 2500, 'English', 'adults', 1, '2025-06-22 22:11:38', 'History', 'Fatima the Historian', 'thumbnails/oromo_history.jpg', 100.00, '2025-06-22 22:11:38', 0),
(5, 2, 'The Battle of Adwa', 'The inspiring story of Ethiopia\'s victory at the Battle of Adwa in 1896. Learn about the role of Oromo warriors and the significance of this historic event.', 'video', 'stories/battle_of_adwa.mp4', 900, 1500, 'English', 'adults', 1, '2025-06-22 22:11:38', 'History', 'Fatima the Historian', 'thumbnails/adwa_battle.jpg', 120.00, '2025-06-22 22:11:38', 0),
(6, 2, 'Traditional Oromo Governance', 'Explore the traditional Oromo governance system known as Gadaa. This story explains the democratic principles and social organization of traditional Oromo society.', 'text', 'stories/gadaa_system.txt', NULL, 1800, 'English', 'adults', 1, '2025-06-22 22:11:38', 'History', 'Fatima the Historian', 'thumbnails/gadaa_system.jpg', 80.00, '2025-06-22 22:11:38', 0),
(7, 3, 'The Creation Myth of Waaqa', 'Ancient Oromo mythology about the creation of the world by Waaqa (God). This spiritual story explains the Oromo understanding of the universe and human existence.', 'audio', 'stories/waaqa_creation.mp3', 720, 2000, 'Afaan Oromo', 'all', 1, '2025-06-22 22:11:38', 'Mythology', 'Mohammed the Mythmaker', 'thumbnails/waaqa_creation.jpg', 90.00, '2025-06-22 22:11:38', 0),
(8, 3, 'The Legend of the Sacred Tree', 'A mystical story about a sacred tree that connects the physical world with the spiritual realm. This story explores Oromo spiritual beliefs and the importance of nature.', 'video', 'stories/sacred_tree.mp4', 540, 1200, 'English', 'all', 1, '2025-06-22 22:11:38', 'Mythology', 'Mohammed the Mythmaker', 'thumbnails/sacred_tree.jpg', 85.00, '2025-06-22 22:11:38', 0),
